import React from 'react';
import styled from 'styled-components';

import { Filter } from './Filter/';

const Wrapper = styled.div`
  margin-top: 50px;
  display: flex;
  flex-flow: row wrap;
  max-width: 750px;
  justify-content: space-between;
`;

export const Main = props => {
  return (
    <Wrapper>
      <Filter></Filter>
    </Wrapper>
  );
}
